import './App.css';
import Login from './components/Login';
// import Navbar from './components/Navbar';
// import TextForm from './components/TextForm';
import {Routes,Route} from 'react-router-dom';


function App() {
  return (
    <>
    <Routes>
      <Route path='/' element={true} component={<Login/>}/>

    </Routes>
    </>
  );
}

export default App;
